function lineChart(ID,data,func){
	//获取数据
	var dataset = data;	

	var areaName = new Array()
	var week = new Array()
	for(var i = 0; i < dataset.length; i++) {
		areaName.push(dataset[i].x)
		week.push(dataset[i].y)
	}
	console.log(areaName)
	//创建画布
	var svg = d3.select('#' + ID),
		margin = {
			top: 20,
			right: 30,
			bottom: 30,
			left: 70
		},
		width = +svg.attr("width") - margin.left - margin.right,
		height = +svg.attr("height") - margin.top - margin.bottom,
		g = svg.append("g").attr("transform", "translate(" + margin.left + "," + margin.top + ")")
	//创建Y轴
	var y = d3.scaleLinear()
		.rangeRound([height, 0]);
	//Y轴添加点
	y.domain(d3.extent(week, function(d) {
		return d;
	})).nice();
	//画出Y轴
	g.append("g")
		.call(d3.axisLeft(y))
		.style("font-size","15px")
		.append("text")
		.attr("fill", "#000")

	//创建X轴
	var x = d3.scaleLinear()
		.rangeRound([0, width]);
	//X轴添加点
	x.domain(d3.extent(areaName, function(d) {
		return d;
	}));
	//画出X轴
	g.append("g")
		.call(d3.axisBottom(x).ticks(areaName.length))
		//让X轴在下方
		.attr("transform", "translate(0," + height + ")")
		.selectAll("text")
		.text(function(d,i){
			if(func == 'week'){
				if(d == 0){
					return '周一'
				}else if(d == 1){
					return '周二'
				}else if(d == 2){
					return '周三'
				}else if(d == 3){
					return '周四'
				}else if(d == 4){
					return '周五'
				}else if(d == 5){
					return '周六'
				}else if(d == 6){
					return '周日'
				}
			}else if(func == 'month')
			{
				return areaName[i] + '月';
			}else{
				return d;
			}
		})
		.style("font-size","20px")
		.append("text")
		.attr("fill", "#000")
		

	//添加系列的小圆点
	svg.selectAll("circle")
		.data(dataset)
		.enter()
		.append("circle")
		.attr("cx", function(d,index) {
			var num = index+1;
			return x(num) + margin.left;
		})
		.attr("cy", function(d) {
			return y(d.y) + margin.top;
		})
		.attr("r", 5)
		.attr("fill", "#FF0");
	
	//点连成线
	var line = d3.svg.line()
		.x(function(d,index) {
			var num = index+1;
			return x(num)+ margin.left;
		})
		.y(function(d) {
			return y(d.y)+ margin.top;
		});
	var path = svg.append("path")
		.attr("d", line(dataset))
		.style("fill", "#F00")
		.style("fill", "none")
		.style("stroke-width", 1)
		.style("stroke", "#FF0")
		.style("stroke-opacity", 0.9);
}











Date.prototype.Format = function (fmt) { //author: meizz
	var o = {
		"M+": this.getMonth() + 1, //月份
		"d+": this.getDate(), //日
		"h+": this.getHours(), //小时
		"m+": Math.floor(this.getMinutes()/10)*10, //分-取整
		"s+": this.getSeconds(), //秒
		"q+": Math.floor((this.getMonth() + 3) / 3), //季度
		"S": this.getMilliseconds() //毫秒
	};
	if (/(y+)/.test(fmt)) fmt = fmt.replace(RegExp.$1, (this.getFullYear() + "").substr(4 - RegExp.$1.length));
	for (var k in o)
		if (new RegExp("(" + k + ")").test(fmt)) fmt = fmt.replace(RegExp.$1, (RegExp.$1.length == 1) ? (o[k]) : (("00" + o[k]).substr(("" + o[k]).length)));
	return fmt;
}

