function lingyageFun() {
	var _span = $('.lingyage div span');
	var zongW = $('.lingyage').width() * 2;
	_span.each(function() {
		lingyageWidthFun($(this), parseInt($(this).attr('_width')), zongW);
	});
}

function lingyageWidthFun(e, w, zongW) {
	var num = 0;
	var speed = 8;
	var jdTimer = setInterval(function() {
		// num = num + 2 * 1.2;
		num = num + 2;
		if(num <= w) {
			e.css({
				'width': num
			});
			e.siblings('em').text(Math.round(num / zongW * 100) + "%");
		} else {
			e.css({
				'width': w
			});
			e.siblings('em').text(Math.round(w / zongW * 100) + "%");
			clearInterval(jdTimer);
		}
	}, speed);
}

