function venueData(){
	var venue_name = areaName(areaPlaceNum);
	$("#huodongqushitu").children().remove()
	$("#yonghuqushitu").children().remove()
	
	$.ajax({
		async:'false',
		url:'getdata.jsp?uid=22',
		success: function(data){
			var jsondata = parseJson(data);
			var total = jsondata["total"];
			var timesegment = jsondata["timesegment"];
			var lineChart_orderList = new Array();
			var lineChart_actNumList = new Array();
			
			
			
			for(var i = 0; i < jsondata.timesegment.length;i++){
				//折线图数据
				if(venue_name == jsondata.timesegment[i].venue_name){
					var lineChart_orderObj = new Object();
					lineChart_orderObj.x = parseInt(jsondata.timesegment[i].month.split('-')[1]);
					lineChart_orderObj.y = jsondata.timesegment[i].orderNum;
					lineChart_orderList.push(lineChart_orderObj);
				}
				
				if(venue_name == jsondata.timesegment[i].venue_name){
					var lineChart_actNumObj = new Object();
					lineChart_actNumObj.x = parseInt(jsondata.timesegment[i].month.split('-')[1]);
					lineChart_actNumObj.y = jsondata.timesegment[i].actNum;
					lineChart_actNumList.push(lineChart_actNumObj);
				}
			}				
			
			for(var i=0;i<total.length;i++)
			{
			
				if(venue_name == total[i]["venue_name"])
				{
					var datavenue = $("#venuedata");
					datavenue.find("div.venuename").html(total[i]["venue_name"]);
					datavenue.find("span.venueact").html(total[i]["actNum"]);
					datavenue.find("span.venuepv").html(total[i]["pv"]);
					datavenue.find("span.orderNum").html(total[i]["orderNum"]);
					datavenue.find("span.peopleNum").html(total[i]["peopleNum"]);

					var fa = total[i]["favorite"].split(",")
					if(fa.length >= 4)
					{
						var totalnum = 0;
						var totalrate = 0;
						for(var x=0;x<4;x++)
						{
							totalnum += parseInt(fa[x].substring(fa[x].indexOf(":")+1))
						}

						for(var x=0;x<4;x++)
						{
							var num;
							if(x < 3)
							{
								num = parseInt(fa[x].substring(fa[x].indexOf(":")+1))
								num = Math.floor(num / totalnum * 100);
								// if(num == 0)
								// {
								// 	num = 1
								// }
								totalrate += num;
							}
							else
							{
								num = 100-totalrate
							}
							datavenue.find("div.favorite"+(x+1)).html(fa[x].substring(0,fa[x].indexOf(":")));
							datavenue.find("div.favorite"+(x+1)+"num").html(num);
						}

					}

					var female = total[i]["femaleNum"];
					var male = total[i]["maleNum"];
					var males= Math.floor((female / (female + male) * 100))
					var females = 100 - males;
					datavenue.find("div.male").html(males+'');
					datavenue.find("div.female").html(females+'');
						
					$(".proportion").html(Math.round(males/10) + ":" + (10-Math.round(males/10)))
				}
			}
			
			lineChart('huodongqushitu',lineChart_actNumList,'month')
			lineChart('yonghuqushitu',lineChart_orderList,'month')
			
			
			var chartData = new Array();
			for(var i=0;i<timesegment.length;i++)
			{
				if(venue_name == timesegment[i]["venue_name"])
				{
					chartData.push(timesegment[i]);
				}
			}
	    }
	})
	$(".mainCoverVenue").fadeIn(1000);
}





